var FipeProvider = Class.create();
FipeProvider.prototype = {
    initialize: function() {},
    getMarcas: function() {
        var rest = new sn_ws.RESTMessageV2('Fipe', "getMarcas");
        rest.setStringParameter("marca", name);

        var response = rest.execute();
        var responseBody = response.haveError() ? response.getErrorMessage() : response.getBody();

        return responseBody;
    },
    type: 'FipeProvider'
};
